import React, { Component } from "react";
import "./index.css";
import { Link } from "react-router-dom";

export class Home extends Component {
  constructor(props) {
    super(props);
    this.State = {
      movie: "",
    };
  }
  render() {
    return (
      <div className="container">
        <form action="submit">
          <input type="search" placeholder="Insert movie" />
          <Link></Link>
        </form>
      </div>
    );
  }
}

export default Home;
